import React from 'react'
import './Sidebar.css';
import SidebarRow from './SidebarRow';
import LocalHospitalIcon from '@material-ui/icons/LocalHospital';
import EmojiFlagsIcon from '@material-ui/icons/EmojiFlags';
import PeopleIcon from '@material-ui/icons/People';
import StorefrontIcon from '@material-ui/icons/Storefront';
import VideoLibraryIcon from '@material-ui/icons/ViideoLibrary';
function Sidebar() {
    return (
        <div className='sidebar'>
         <SidebarRow  src='https://i.pinimg.com/736x/42/2c/d6/422cd6c374b4334615c0d53d1809191d.jpg ' title= 'abaad'/>
         <SidebarRow  Icon={LocalHospitalIcon} 
         title='Brutal Hell Hackers'/>
         <SidebarRow Icon={EmojiFlagsIcon} title='pages'/>
         <SidebarRow Icon={PeopleIcon} title='friends'/>
         <SidebarRow Icon={StorefrontIcon} title='market place'/>
         <SidebarRow Icon={VideoLibraryIcon} title='video'/>
        </div>
    )
}

export default Sidebar
